import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on the account dropdown
    await page.waitForSelector('.account-lists', { timeout: 5000 });
    await page.click('.account-lists');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_account_dropdown.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_account_dropdown.png'));

    // Wait for and click on "Your Profile" link in the dropdown
    await page.waitForSelector('.dropdown-content a[href="#"]', { timeout: 5000 });
    const profileLinks = await page.$$('.dropdown-content a[href="#"]');
    for (const link of profileLinks) {
      const text = await link.textContent();
      if (text.trim() === 'Your Profile') {
        await link.click();
        break;
      }
    }

    // Wait for profile page to load and take screenshot
    await page.waitForSelector('.profile-header', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_profile_page.png'));

    // Extract profile information
    const profileName = await page.$eval('.profile-info h2', el => el.textContent.trim());
    const username = await page.$eval('.username', el => el.textContent.trim());
    const bio = await page.$eval('.bio', el => el.textContent.trim());

    return {
      success: true,
      action: "Navigated to Jun's Profile page successfully",
      extractedData: {
        profileName,
        username,
        bio
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to navigate to Jun's Profile",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
